  <title>Hanif's Profile</title>
  <link href="https://fonts.googleapis.com/css2?family=Segoe+UI&display=swap" rel="stylesheet">
  <script src="https://unpkg.com/scrollreveal"></script>
  <style>
    body {
      font-family: 'Segoe UI', sans-serif;
      background: linear-gradient(to right, #d7e1ec, #f4f6f9);
      display: flex;
      justify-content: center;
      padding: 30px 10px;
      min-height: 100vh;
      flex-direction: column;
      align-items: center;
    }
    .card {
      background-color: #fff;
      border-radius: 20px;
      box-shadow: 0 10px 20px rgba(0,0,0,0.1);
      max-width: 400px;
      width: 100%;
      text-align: center;
      padding: 30px 20px;
      margin-bottom: 20px;
    }
    .profile-img {
      width: 120px;
      height: 120px;
      border-radius: 50%;
      object-fit: cover;
      border: 3px solid #0077ff;
      margin-bottom: 15px;
    }
    h1 {
      font-size: 24px;
      margin-bottom: 5px;
      color: #222;
    }
    .subtitle {
      font-size: 16px;
      color: #555;
      margin-bottom: 10px;
    }
    .bio {
      font-size: 14px;
      color: #333;
      margin-bottom: 20px;
    }
    .info {
      text-align: left;
      font-size: 14px;
      color: #333;
      margin-bottom: 20px;
    }
    .info p {
      margin: 5px 0;
    }
    .info strong {
      color: #000;
    }
    .social-links a {
      margin: 0 8px;
      text-decoration: none;
      color: #0077ff;
      font-weight: bold;
      transition: color 0.3s ease;
    }
    .social-links a:hover {
      color: #ff6600;
    }
  </style>
